	private static boolean isPeak(int[] values, int index)
	{
		return index<values.length-1 && index>0
			&&	values[index]>values[index-1] && values[index]>=values[index+1];
	}
	
	private static boolean isTrough(int[] values, int index)
	{
		return index<values.length-1 && index>0
				&&	values[index]<values[index-1] && values[index]<=values[index+1];
	}
